def calcula_soma_energia_artistas_selecionados(energia, artistas, Artista):
  soma = 0
  media = 0
  energiaartist = []
  for i in range(len(artistas)):
    if artistas[i] == Artista:
      energiaartist.append(energia[i])
      soma = soma + energia[i]
      media = soma / len(energiaartist)
  return media

